import React from "react";

function SingleCondition(props)
{
    return(
        <div>
            <select
                conditionindex={props.conditionindex}
                name="conditionType"
                value={props.conditionType}
                onChange={props.onChange}
            >
                <option value="">-- select something --</option>
                <option value="required">required</option>
                <option value="optional">optional</option>
            </select>
            &nbsp;&nbsp;&nbsp;
            <input id="count" style={{width: 40}} min="1" type="number" />
            &nbsp;&nbsp;&nbsp;
            <select>
                <option>-- select something --</option>
                <option>leadership training</option>
                <option>drivers licence</option>
                <option>some other training</option>
                <option>more stuff</option>
            </select>
            &nbsp;&nbsp;&nbsp;
            <button 
                conditionindex={props.conditionindex} 
                onClick={props.onRemove}
            >
                remove
            </button>
        </div>
    );
}
export default SingleCondition;
